import Nav from 'react-bootstrap/Nav';
import '../css/Navbar.css';
import React, {Component} from 'react';
import pages from '../pages.json'


class Navbar extends Component {

    constructor(props){
        super(props);
        this.onSelect = (props.onSelect === undefined) ? (id) => console.log("Navigation selected", id) : props.onSelect;
    }

    NavItem(title, id){
        return (
            <Nav.Item activekey={this.id}>
                <Nav.Link onSelect={() => this.onSelect(id)} href={"#"+id}> {title} </Nav.Link>
            </Nav.Item>
        )
    }


    render(){
        this.content_left = pages.left.map((item) => this.NavItem(item.title, item.id));
        this.content_right = pages.right.map((item) => this.NavItem(item.title, item.id));

        return (
            <Nav className={"clearfix"}>
                <div className={"left"}>
                    {this.content_left}
                </div>

                <div className={"right"}>
                    {this.content_right}
                </div>
            </Nav>
        )
    }
}


export default Navbar
